export class Event {
    constructor(JSONObject) {
        this.title = JSONObject.title;
        this.startTime = JSONObject.startTime;
        this.endTime = JSONObject.endTime;
        this.duration = (endTime - startTime) / 60000;
    }

    isAllDayEvent() {
        return this.duration == 1440;
    }
}

export class Calendar {
    constructor(title, color, events) {
        this.title = title;
        this.color = color;
        this.events = events;
    }
}

export class User {
    constructor(JSONObject) {
        this.username = JSONObject.username;
        this.calendars = JSONObject.calendars.map(calendar => {
            return new Calendar(calendar);
        });
    }
}
